import React, { Component } from 'react';

class Todos extends Component {
    render() {
        if (this.props.todos) {

            return this.props.todos.map((todo) => (
                <div>
                    <button>HELLO + {todo.title}</button>
                    <h3>
                    </h3>
                </div>
            ));
        }
        return <h3>no todos found</h3>
    };
}

export default Todos;
